            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_inheritance ],
        :autosomal_genetic_disease,
        :syndromic_microphthalmia ;
    :has_definition "A syndromic microphthalmia characterized by microcephaly, microphthalmia, ectrodactyly of the lower limbs, prognathism and intellectual disability that has_material_basis_in mutation in a region of chromosome 6q21." ;
    :has_exact_synonym "MCOPS8",
        "MMEP syndrome",
        "Viljoen-Smart syndrome",
        "microcephaly-microphthalmia-ectrodactyly of lower limbs-prognathism syndrome",
        "syndromic microphthalmia type 8" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

