    :has_definition "A syndromic microphthalmia characterized by microphthalmia, cleft lip and palate, and agenesis of the corpus callosum that has_material_basis_in homozygous or compound heterozygous mutation in VAX1 on chromosome 10q25.3." ;
    :has_exact_synonym "MCOPS11" .

