        :autosomal_dominant_disease,
        :syndromic_microphthalmia ;
    :has_definition "A syndromic microphthalmia characterized by unilateral or bilateral microphthalmia or clinical anophthalmia and variable additional features that has_material_basis_in heterozygous mutation in the OTX2 gene on chromosome 14q22.3." ;
    :has_exact_synonym "MCOPS5",
