    :has_definition "A syndromic microphthalmia characterized by colobomatous microphthalmia, microcephaly, short stature, and psychomotor retardation that has_material_basis_in mutation in the HMGB3 gene on chromosome Xq28." ;
    :has_exact_synonym "MCOPS13",
