@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:syndromic_microphthalmia_10 rdfs:subClassOf :syndromic_microphthalmia ;
    :has_definition "A syndromic microphthalmia characterized by congenital microphthalmia and blindness, microcephaly, progressive spasticity, seizures, progressive atrophy of the brain and profound intellectual disability." ;
    :has_exact_synonym "MCOPS10",
        "MOBA",
        "microphthalmia-brain atrophy syndrome" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

