                            owl:onProperty :has_material_basis_in ;
                            owl:someValuesFrom :chromosome ] ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :has_material_basis_in ;
                                    owl:someValuesFrom :duplication ] ;
                            rdf:rest :nil ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :chromosomal_duplication_syndrome,
        :syndactyly ;
    :has_definition "A syndactyly characterized by complete or partial webbing between the third and fourth fingers and/or the second and third toes that has_material_basis_in heterozygous duplication of a region of chromosome 2q34-q36." ;
    :has_exact_synonym "SDTY1",
        "chromosome 2q35 duplication syndrome",
        "syndactyly, type 1, with or without craniosynostosis" .

