@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:immunodeficiency_31a rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :primary_immunodeficiency_disease ;
    :has_definition "A primary immunodeficiency disease characterized by impaired response to IFNG but not to INFA or IFNB resulting in increased susceptibility to mycobacterial infection that has_material_basis_in heterozygous mutation in the STAT1 gene on chromosome 2q32.2." ;
    :has_exact_synonym "IMD31A",
        "MSMD due to partial STAT1 deficiency",
        "MSMD due to partial signal transducer and activator of transcription 1 deficiency",
        "Mendelian susceptibility to mycobacterial diseases due to partial STAT1 deficiency",
        "Mendelian susceptibility to mycobacterial diseases due to partial signal transducer and activator of transcription 1 deficiency",
        "autosomal dominant immunodeficiency 31A, mycobacteriosis" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:immunodeficiency_31c rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :primary_immunodeficiency_disease ;
    :has_definition "A primary immunodeficiency disease characterized by onset in infancy or childhood of chronic mucocutaneous candidiasis and increased IFNG activation that has_material_basis_in heterozygous gain of function mutation in the STAT1 gene on chromosome 2q32.2." ;
    :has_exact_synonym "CANDF7",
        "IMD31C",
        "autoimmune enteropathy and endocrinopathy-susceptibility to chronic infections syndrome",
        "autosomal dominant chronic mucocutaneous familial candidiasis",
        "autosomal dominant immunodeficiency 31C",
        "familial candidiasis 7" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:immunodeficiency_21 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :primary_immunodeficiency_disease ;
    :has_definition "A primary immunodeficiency disease characterized by profoundly decreased or absent monocytes, B lymphocytes, natural killer (NK) lymphocytes, and circulating and tissue dendritic cells with normal or nearly normal T cell numbers that has_material_basis_in heterozygous mutation in the GATA2 gene on chromosome 3q21.3." ;
    :has_exact_synonym "DCML",
        "GATA2 deficiency",
        "IMD21",
        "MonoMAC",
        "combined immunodeficiency with susceptibility to mycobacterial, viral and fungal infections",
        "dendritic cell, monocyte, B and NK lymphoid deficiency",
        "monocyte-B-natural killer-dendritic cell deficiency syndrome",
        "monocytopenia and mycobacterial infection syndrome",
        "monocytopenia with susceptibility to infections" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:immunodeficiency_46 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :combined_t_cell_and_b_cell_immunodeficiency ;
    :has_definition "A combined T cell and B cell immunodeficiency characterized by hypo- or agammaglobulinemia, normal lymphocyte counts, intermittent neutropenia, intermittent thrombocytopenia, decreased numbers of memory B cells, impaired immunoglobulin class-switching, and decreased proliferative responses of T cells that has_material_basis_in homozygous or compound heterozygous mutation in the TFRC gene on chromosome 3q29." ;
    :has_exact_synonym "CID due to TFRC deficiency",
        "IMD46",
        "TFRC-related combined immunodeficiency",
        "combined immunodeficiency due to TFRC deficiency" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:immunodeficiency_36 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :combined_t_cell_and_b_cell_immunodeficiency ;
    :has_definition "A combined T cell and B cell immunodeficiency characterized by recurrent respiratory tract infections, lymphoproliferation, and antibody deficiency that has_material_basis_in heterozygous mutation in the PIK3R1 gene on chromosome 5q13.1." ;
    :has_exact_synonym "IMD36",
        "activated phosphoinositide 3-kinase delta syndrome 2" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:immunodeficiency_29 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :primary_immunodeficiency_disease ;
    :has_definition "A primary immunodeficiency disease characterized by undetectable IL12B secretion by leukocytes and increased susceptibility to intracellular bacterial infections that has_material_basis_in homozygous or compound heterozygous mutation in the IL12B gene on chromosome 5q33.3." ;
    :has_exact_synonym "IL12B deficiency",
        "IMD29",
        "MSMD due to complete IL12B deficiency",
        "MSMD due to complete interleukin 12B deficiency",
        "Mendelian susceptibility to mycobacterial diseases due to complete IL12B deficiency",
        "Mendelian susceptibility to mycobacterial diseases due to complete interleukin 12B deficiency",
        "immunodeficiency 29, mycobacteriosis" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:immunodeficiency_40 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :combined_t_cell_and_b_cell_immunodeficiency ;
    :has_definition "A combined T cell and B cell immunodeficiency characterized by reduced T-cell number and function, with variable defects in B-cell and NK-cell function resulting in onset in early childhood of invasive bacterial and viral infections that has_material_basis_in homozygous or compound heterozygous mutation in the DOCK2 gene on chromosome 5q35.1." ;
    :has_exact_synonym "DOCK2 deficiency",
        "IMD40" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:immunodeficiency_57 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :primary_immunodeficiency_disease ;
    :has_definition "A primary immunodeficiency disease characterized by recurrent infections starting in the first year of life, lymphopenia, altered production of various cytokines, inflammatory polyarthritis, and chronic active inflammation of the digestive tract that has_material_basis_in homozygous or compound heterozygous mutation in the RIPK1 gene on chromosome 6p25.2." ;
    :has_exact_synonym "IMD57",
        "immune dysregulation-inflammatory bowel disease-arthritis-recurrent infections-lymphopenia syndrome",
        "immunodeficiency 57 with autoinflammation" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:immunodeficiency_23 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :combined_t_cell_and_b_cell_immunodeficiency ;
    :has_definition "A combined T cell and B cells immunodeficiency characterized by marked atopy and autoimmunity caused by increased T(H)2 and T(H)17 cytokine production by CD4(+) T cells, T-cell lymphopenia, reduced memory B-cell numbers, recurrent respiratory and skin infections beginning in early childhood, increased serum IgE, and variable developmental delay or intellectual impairment that has_material_basis_in homozygous or compound heterozygous mutation in the PGM3 gene on chromosome 6q14.1." ;
    :has_exact_synonym "CID due to PGM3 deficiency",
        "IMD23",
        "PGM3-CDG",
        "PGM3-related congenital disorder of glycosylation",
        "combined immunodeficiency due to PGM3 deficiency" .
